import java.util.*;
import java.io.*;

public class Main {
    static class Point {
        double x, y;

        public Point(double x, double y) {
            this.x = x;
            this.y = y;
        }
    }

    static class Block {
        Point p1, p2;
        double h;

        public Block(Point p1, Point p2, double h) {
            this.p1 = p1;
            this.p2 = p2;
            this.h = h;
        }
    }

    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        int T = 1;
        while (T-- > 0) {
            int N = Integer.parseInt(br.readLine());
            String[] line = br.readLine().split(" ");
            Point start = new Point(Double.parseDouble(line[0]), Double.parseDouble(line[1]));
            Point end = new Point(Double.parseDouble(line[2]), Double.parseDouble(line[3]));
            Block[] blocks = new Block[N];
            for (int i = 0; i < N; i++) {
                line = br.readLine().split(" ");
                Point p1 = new Point(Double.parseDouble(line[0]), Double.parseDouble(line[1]));
                Point p2 = new Point(Double.parseDouble(line[2]), Double.parseDouble(line[3]));
                double h = Double.parseDouble(line[4]);
                blocks[i] = new Block(p1, p2, h);
            }
            double ans = check(start, end, blocks);
            System.out.printf("%.6f\n", ans);
        }
    }

    static double check(Point start, Point end, Block[] blocks) {
        double minx = Math.min(start.x, end.x);
        double maxx = Math.max(start.x, end.x);
        double miny = Math.min(start.y, end.y);
        double maxy = Math.max(start.y, end.y);
        double[] x = new double[(int) (maxx - minx + 1)];
        double[] y = new double[(int) (maxy - miny + 1)];
        for (int i = 0; i < x.length; i++) {
            x[i] = minx + i;
            y[i] = miny;
        }
        for (int i = 0; i < x.length; i++) {
            y[i] = miny + 1;
            for (Block block : blocks) {
                if (block.p1.x <= x[i] && x[i] <= block.p2.x && block.p1.y <= y[i] && y[i] <= block.p2.y) {
                    return 0;
                }
            }
        }
        for (int i = 0; i < y.length; i++) {
            x[i] = maxx;
            y[i] = miny + i;
        }
        for (int i = 0; i < y.length; i++) {
            x[i] = maxx - 1;
            for (Block block : blocks) {
                if (block.p1.x <= x[i] && x[i] <= block.p2.x && block.p1.y <= y[i] && y[i] <= block.p2.y) {
                    return 0;
                }
            }
        }
        double ans = 0;
        for (int i = 0; i < x.length; i++) {
            for (int j = 0; j < y.length; j++) {
                double r = Math.sqrt(Math.pow(x[i] - start.x, 2) + Math.pow(y[j] - start.y, 2));
                double d = Math.sqrt(Math.pow(x[i] - end.x, 2) + Math.pow(y[j] - end.y, 2));
                if (r + d - r * r / d < blocks[0].h) {
                    ans = Math.max(ans, r);
                }
            }
        }
        return ans;
    }
}
